Απορώ με όλους εσάς που σφαξατε τον Τζέιμς για την ψήφο του στον Καλλιδη. Ο χειρότερος ειναι, αλλο παιχνίδι βλεπουμε;
Πριν με φάτε, κόκκινους υποστηρίζω αλλα εχω και λογική μεσα στο κεφάλι μου.
Παλτο απο τα λίγα ο Πάνος, άξιος διάδοχος της Ανθής

Η Ελένη μέχρι τώρα συμπαθέστατη. 
Αλλά μήπως είναι ξανθιά έκδοση Ανθής αγωνιστικά;
#survivorGR

#survivorGR Τι έγινε στρουμφάκια;
Σας έμεινε αμανάτι ο Καλλίδης κ ονειρεύεστε επιστροφή Ανθής στους Κόκκινους;
Με το όνειρο θα μείνετε,ζαβά!

- Του γαμπρού η της νύφης;
- Της Ανθής. 
 #survivorGR https://t.co/cWz9k7Aw76

- Σοφία γιατί κλαις;
- Συγκινήθηκα που θα δω τον μπαμπά της Ανθής, τον κύριο Σαλαγκούδη!
#SurvivorGr https://t.co/CszMxjJqVT

-Σοφία πες μας γιατί να σε ψηφίσει ο κόσμος να μείνεις;
-Ο πατέρας Σαλαγκούδης, ο Σαλαγκούδης, ο κυρ Σαλαγκούδης κι ο μπαμπάς της Ανθής. Α, και ο κύριος Σαλαγκούδης που έχει μια υπέροχη κόρη. Επίσης άφησα τη δουλειά και τα παιδιά μου κι εχω οικονομικά προβλήματα.

#survivorGR

- Σοφία εννοείς ότι πιάσαμε τους νέους παίκτες και τους είπαμε να σε ψηφίσουν;
- Ντάφυ ο πατήρ Σαλαγκουδης έχει λεφτά, έχω τα παιδιά μου εγώ, στηρίζω την Ανθή, ο πατέρας της Ανθής εμένα, εγώ ήρθα για τα παιδιά μου εδώ.
#survivorGR

Ο κοκκινοτρίχης που έχει καψαλιστεί χειρότερα κι από μπριζόλα στα κάρβουνα,το παίζει δικηγόρος της Ανθής;
Πού τα πουλάς αυτά μαρή;;;;;
#survivorGR

