Η Ελισαβετ, κι αυτην πατερα πολιτικο ειχε;
Η Ροδανθη;
Βλακειες βραδιατικα

Κάνεις από τους συμμετέχοντες στο #survivorGR δε ξέρει τον πατέρα της Ανθής.
Συμπέρασμα;;;;
Κανείς δεν τον ψήφισε! 🤣🤣🤣

Αλλη μια φορα που εξαιτίας του -2 της Ανθής οι κόκκινοι έχασαν 10-5. Να φύγει τωρα. 
Τι εννοείς δε βγαίνουν τα νούμερα; 
 #survivorGR

Ο πατέρας και  η μάνα της Ανθής , είναι τόσο ηλίθιοι, δεν βλέπουν ότι έχουν μια κόρη άχρηστη σε όλα που γίνεται ρεζίλι κάθε μέρα  ;
Δεν σκέφτονται όταν θα βγει και δει τα στιγμιότυπα θα πάθει;
#survivorGR

Ποιος να ταυτιστεί ρε με Ανθη; 
Μέχρι ένα επίπεδο φτάνουμε όλοι στο να ταυτιστούμε ...το επίπεδο της Λάουρας...
Το επίπεδο της Ανθής είναι πρωτοφανές γεγονός, θα έπρεπε να προβληθεί παγκοσμίως να γελάνε με τα χάλια μας...κανένας δεν θα μπορούσε να τα πάει χειρότερα. #elaxamogela

Ο πατερας της Ανθης δεν νιωθει λιγο υπαιτιος για το μπουλινγκ που τρωει και θα συνεχισει να τρωει η κορη του οταν βγει απο το παιχνιδι; 
Δηλαδη δεν νιωθεις λιγες τυψεις ρε φιλε;
#survivorGR

Παιδιά ψήνεστε να ξεκινήσουμε μια διαμαρτυρία μερικοί από δω, δύο τρεις χίλιοι δεκατρείς δε ξέρω.... Κάνα δύο πλακάτ, έξω από υπουργείο πολιτισμού, Σύνταγμα, εθνικό, δεν ξέρω που.. Κάποιος πρέπει να κάνει την αρχη, όχι;
#λιγναδης
 το #eimasteoloimazi διαφωνεί;
Το #MeToo ;
#ανθης

Για ποιόν ηθοποιό λένε;
Ήταν είπε σε φετινό σίριαλ, είναι και σκηνοθέτης και νομίζω ήταν και σε πάνελ εκπομπής. Μήπως έχει καταλάβει κανείς;
